  [],\n\t\"revision_timestamp\": \"2013-03-15T20:47:08.849983\",\n\t\"name\": \"10mcontour-10-meter-bathymetric-contours-of-the-gulf-of-the-farallones-region\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 1989, the U.S. Geological Survey (USGS)
  began a major geologic and oceanographic investigation of the Gulf of the Farallones
  continental shelf system, designed to evaluate and monitor human impacts on the
  marine environment (Karl and others, 2002). The study region is located off the
  central California coast, adjacent to San Francisco Bay and encompasses the Gulf
  of the Farallones National Marine Sanctuary. Geologic mapping of this area included
  the use of various remote sensing and sampling techniques such as sub-bottom profiling,
  sidescan-sonar and bathymetric mapping, gravity core and grab sampling, and photography.
  These data were used to define the surficial sediment distribution, underlying structure
  and sea floor morphology of the study area. The primary focus of this report is
  to present a georeferenced, digital sidescan-sonar mosaic of the study region. The
  sidescan-sonar data were acquired with the AMS-120 (120kHz) sidescan-sonar system
  during USGS cruise F9-89-NC. The dataset covers approximately 1000 km squared of
  the continental shelf between Point Reyes, California and Half Moon Bay, California,
  extending west to the continental shelf break near the Farallon Islands. The sidescan-sonar
  mosaic displays a heterogenous sea-floor environment, containing outcropping rock,
  ripples, dunes, lineations and depressions, as well as flat, featureless sea floor
  (Karl and others, 2002). These data, along with sub-bottom interpretation and ground
  truth data define the geologic framework of the region. The sidescan-sonar mosaic
  can be used with supplemental remote sensing and sampling data as a base for future
  research, helping to define the local current regime and predominant sediment transport
  directions and forcing conditions within the Gulf of Farallones.\",\n\t\"license_title\":
